import java.util.HashMap;

public class findTheDifference {
    static public char solution(String s, String t) {
        char[] sArr = s.toCharArray();
        char[] tArr = t.toCharArray();

        HashMap<Character, Integer> helpSet = new HashMap<>();
        for (int i = 0; i < sArr.length; i++) {
            if (!helpSet.containsKey(sArr[i])) {
                helpSet.put(sArr[i], 1);
            } else {
                int num = helpSet.get(sArr[i]) + 1;
                helpSet.put(sArr[i], num);
            }
        }

        for (int i = 0; i < tArr.length; i++) {
            if (helpSet.containsKey(tArr[i])) {
                int num = helpSet.get(tArr[i]) - 1;
                if (num < 0) return tArr[i];
                helpSet.put(tArr[i], num);
            } else {
                return tArr[i];
            }
        }

        return tArr[0];
    }

    public static void main(String[] args) {
        String s = "";
        String t = "";
        System.out.println(solution(s, t));

    }
}
